            <label>
              Select a date:
              <input type="text" value={this.state.value} onChange={this.handleChange} />
            </label>
            <label>
              Select a time:
              <input type="text" value={this.state.value} onChange={this.handleChange} />
            </label>
            <label>
              Select your seating number:
              <input type="text" value={this.state.value} onChange={this.handleChange} />
            </label>

            <input type="submit" value="BOOK" />
        </form>


      </div>
    ); 

  }

